import React from 'react';
import PaymentForm from './PaymentForm';

const PaymentPage = () => {
  const checkoutId = '707d4b1db03d4e66b7f36ae2f27c35fa'; // Replace with your actual checkoutId
  const shopperResultUrl = 'https://myplusplus.com'; // Replace with your actual result URL

  return (
    <div>
      <h1>Payment Page</h1>
      <PaymentForm checkoutId={checkoutId} shopperResultUrl={shopperResultUrl} />
    </div>
  );
};

export default PaymentPage;
